【ピッタリ背抜きプレス ブルー Mサイズの詳細】<br>
●手のひらに発泡ポリウレタンをコーティングし、独自のS-press仕上げを施した通気性に優れた背抜き手袋です。<br>
●特殊配合のポリウレタンを採用し、負荷のかかりやすい指先を強化しています。<br>
●S-press仕上げにより柔軟性に優れ、手の動きにフィットします。<br>
●発泡ポリウレタンを手のひらにコーティングしているため、高いスベリ止め効果を発揮します。<br>
●繊維部分は編み目が細かく縫い合わせのない、独自の13ゲージ・シームレス編み手袋です。<br>
●裾部分は、ほつれを防ぐオーバーロック加工を施しています。<br><br>

【用途】<br>
農業、清掃・サービス業、運輸・物流業、食品関連業、機械工業、精密機械工業など<br><br>

【ご注意】<br>
○アレルギー反応等により、体質によっては、かゆみ・かぶれ・発疹等をおこすことがあります。異常を感じたら使用を中止し、医師に相談してください。<br>
○樹脂部でも水等の液体は浸透するため、液体には触れないでください。<br>
○熱いものに触れないでください。火傷するおそれがあります。<br>
○回転体を伴う作業（ボール盤・面取り盤等）には使用しないでください。手が巻き込まれるおそれがあります。<br>
○感電のおそれがあるため、電気作業には使用しないでください。<br>
○汚れた場合は洗濯し、陰干ししてください。保管する時には直射日光を避けてください。<br><br>

【素材】<br>
樹脂部：ポリウレタン<br>
繊維部：ナイロン、ポリエステル、その他<br><br>

【サイズ】<br>
Mサイズ<br>
カラー：本体 ブルー、手首 ホワイト<br>
寸法：全長 22.0cm、手のひらまわり 18.5cm、中指長さ 7.7cm<br><br>

【内容量】<br>
1双<br><br>

【販売元】<br>
ショーワグローブ<br>
東京都千代田区九段南1-6-17<br>
お電話：03-3512-3886<br><br>

【商品区分】<br>
日用品<br><br>

[背抜き手袋　ピッタリ背抜き+press] 

<br><br><br><hr>
広告文責：株式会社モリキ<br>
